import React, { useState, useEffect } from 'react';
import { format } from 'date-fns';

const AppointmentBooking = () => {
  const [date, setDate] = useState('');
  const [availableSlots, setAvailableSlots] = useState([]);
  const [selectedSlot, setSelectedSlot] = useState('');
  const [notes, setNotes] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Fetch available slots when date changes
  useEffect(() => {
    const fetchAvailableSlots = async () => {
      if (!date) return;
    
      const token = localStorage.getItem('token');
      if (!token) {
        setError('No authentication token found. Please log in.');
        return;
      }
    
      try {
        const response = await fetch(`http://localhost:3000/api/slots?date=${date}`, {
          method: 'GET',
          headers: {
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json'
          }
        });
    
        if (!response.ok) {
          const errorText = await response.text();
          throw new Error(`Authentication failed: ${errorText}`);
        }
    
        const slots = await response.json();
        setAvailableSlots(slots);
      } catch (err) {
        console.error('Slot fetch error:', err);
        setError(err.message);
      }
    };

    fetchAvailableSlots();
  }, [date]);

  const handleBookAppointment = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    if (!date || !selectedSlot) {
      setError('Please select a date and time slot');
      return;
    }

    try {
      const token = localStorage.getItem('token');
      const response = await fetch('/api/appointments', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          date,
          timeSlot: selectedSlot,
          notes
        })
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Booking failed');
      }

      setSuccess('Appointment booked successfully!');
      setSelectedSlot('');
      setNotes('');
    } catch (err) {
      setError(err.message);
    }
  };

  return (
    <div className="max-w-md mx-auto mt-8 p-6 border rounded shadow-md">
      <h2 className="text-2xl font-bold mb-6">Book an Appointment</h2>
      
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}

      {success && (
        <div className="bg-green-100 border border-green-400 text-green-700 px-4 py-3 rounded mb-4">
          {success}
        </div>
      )}

      <form onSubmit={handleBookAppointment}>
        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Date</label>
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="w-full p-2 border rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Available Time Slots</label>
          {availableSlots.length === 0 ? (
            <p className="text-gray-500">
              {date ? 'No available slots for selected date' : 'Select a date to see available slots'}
            </p>
          ) : (
            <select
              value={selectedSlot}
              onChange={(e) => setSelectedSlot(e.target.value)}
              className="w-full p-2 border rounded"
              required
            >
              <option value="">Select a time slot</option>
              {availableSlots.map(slot => (
                <option key={slot.id} value={slot.id}>
                  {slot.time}
                </option>
              ))}
            </select>
          )}
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Additional Notes (Optional)</label>
          <textarea
            value={notes}
            onChange={(e) => setNotes(e.target.value)}
            className="w-full p-2 border rounded"
            rows="3"
            placeholder="Add any additional information"
          />
        </div>

        <button
          type="submit"
          className="w-full bg-blue-500 text-white py-2 rounded hover:bg-blue-600"
          disabled={!date || !selectedSlot}
        >
          Book Appointment
        </button>
      </form>
    </div>
  );
};

export default AppointmentBooking;
